var app = angular.module('dashboard', ['block-ui','bootstrap-notify','bootstrap-modal','jspdf-module']);

app.controller('dashboardCtrl',function($window,$timeout,$interval,$http,$scope,bootstrapNotify,blockUI,bootstrapModal,jspdf) {
	
	jspdf.init();

	$scope.views = {};	
	$scope.views.portionIndex = 0;
	
	/*
	** startup
	*/	
	$http({
	  method: 'POST',
	  url: 'controllers/dashboard.php?r=startup'
	}).then(function mySucces(response) {

		$scope.judges_list = response.data['judges_list'];
		$scope.contestants_list = response.data['contestants_list'];
		$scope.portions = response.data['portions'];
		
	}, function myError(response) {
		
	});
	
	$scope.editContestant = function(contestant) {
		
		$scope.contestant_status = {};
		
		$scope.views.contestant_status = {
			"No": 0,
			"Yes": 1
		};
		
		var frm = '<form>';
			frm += '<div class="form-group">';
			frm += '<label>No</label>';
			frm += '<input class="form-control" name="no" ng-model="contestant_status.no" type="number">';
			frm += '</div>';
			frm += '<div class="form-group">';
			frm += '<label>Participated</label>';
			frm += '<select class="form-control" name="participated" ng-model="contestant_status.participated" ng-options="x for (x,y) in views.contestant_status track by y">';
			frm += '<option value="">-</option>';
			frm += '</select>';
			frm += '</div>';
			frm += '<div class="form-group">';
			
			frm += '<div class="checkbox" ng-repeat="portion in contestant_status.portions">';
			frm += '<label>';
			frm += '<input type="checkbox" ng-model="portion.value"> {{portion.description}}';
			frm += '</label>';
			frm += '</div>';					

			frm += '</div>';
			frm += '</form>';
			
		bootstrapModal.confirm($scope,contestant.cluster_name,frm,function() { contestantStatus();  },function() {});		
			
		$http({
		  method: 'POST',
		  url: 'controllers/dashboard.php?r=contestant_status',
		  data: {id: contestant.id}
		}).then(function mySucces(response) {
			
			$timeout(function() { $scope.contestant_status = response.data; },500);
		
		}, function myError(response) {
			
		});		
		
		function contestantStatus() {
			
			$http({
			  method: 'POST',
			  url: 'controllers/dashboard.php?r=contestant',
			  data: {id: contestant.id, no: $scope.contestant_status.no, is_active: $scope.contestant_status.participated, portions: $scope.contestant_status.portions}
			}).then(function mySucces(response) {
				
				$scope.contestants_list = response.data['contestants_list'];
			
			}, function myError(response) {
				
			});				
			
		}
		
	};
	
	$scope.editJudge = function(id) {
		
		$scope.judge_status = {};
		
		$scope.judge_status.remarks = "";
		
		var frm = '<form>';
			frm += '<div class="form-group">';
			frm += '<label>Remarks</label>';
			frm += '<input class="form-control" name="remarks" ng-model="judge_status.remarks" type="text">';
			frm += '</div>';			
			frm += '</form>';
			
		bootstrapModal.confirm($scope,'Judge',frm,function() { judgeStatus();  },function() {});		
			
		$http({
		  method: 'POST',
		  url: 'controllers/dashboard.php?r=judge_status',
		  data: {id: id}
		}).then(function mySucces(response) {
			
			$timeout(function() { $scope.judge_status.remarks = response.data; },500);
		
		}, function myError(response) {
			
		});		
		
		function judgeStatus() {
			
			$http({
			  method: 'POST',
			  url: 'controllers/dashboard.php?r=judge',
			  data: {id: id, remarks: $scope.judge_status.remarks}
			}).then(function mySucces(response) {
				
			$scope.judges_list = response.data['judges_list'];
			
			}, function myError(response) {
				
			});				
			
		};
		
	};
	
	$scope.refreshStanding = function() {
		
		$http({
		  method: 'POST',
		  url: 'controllers/dashboard.php?r=startup'
		}).then(function mySucces(response) {

			$scope.judges_list = response.data['judges_list'];
			$scope.contestants_list = response.data['contestants_list'];
			$scope.portions = response.data['portions'];
			
		}, function myError(response) {
			
		});		
		
	};
	
	$scope.logIndex = function(scope,index,portion) {
		
		scope.views.portionIndex = index;
		
	};
	
	$scope.printWinners = function(portion) {
		
		var doc = new jsPDF({
			orientation: 'portrait',
			unit: 'pt',
			format: [792, 612]
		});
		
		/*
		** pglu logo
		*/		
		doc.addImage('data:image/png;base64,', 'PNG', 15, 16, 95, 95);		
		
		/*		
		** i love la union logo
		*/
		doc.addImage('data:image/png;base64,', 'PNG', 495, 15, 100, 100);

		doc.setTextColor(40,40,40);						
		doc.setFontSize(13);
		doc.setFontType('normal');
		doc.myText(portion.info.title,{align: "center"},0,50);

		doc.setFontSize(15);
		doc.setFontType('bold');		
		doc.myText(portion.info.portion,{align: "center"},0,70);

		doc.setFontSize(13);
		doc.setFontType('normal');
		doc.myText("Results",{align: "center"},0,150);

		doc.setFillColor(130,130,130);
		doc.setLineWidth(0.5);
		doc.line(50, 130, 562, 130);
		
		doc.setFontSize(10);
		doc.myText("Tabulator",{align: "center"},0,700,false,300);
		doc.myText("Chairman",{align: "center"},0,700,true,300);
		doc.line(50, 685, 260, 685);
		doc.line(345, 685, 555, 685);

		var columns = [
			{title: "#", dataKey: "no"},
			{title: "Contestant", dataKey: "contestant"},
			{title: "Average", dataKey: "average"},
			{title: "Rank", dataKey: "rank"}
		];				

		var rows = [];

		angular.forEach(portion.winners,function(item,i) {
			if (portion.overall[i]) {
				var winner = {
					no: portion.overall[i]['no'],
					contestant: portion.overall[i]['cluster_name'],
					average: portion.overall[i]['average'],
					rank: portion.overall[i]['overall_rank']
				};
				rows.push(winner);
			}			
		});
		
		doc.autoTable(columns, rows, {
			// tableLineColor: [189, 195, 199],
			// tableLineWidth: 0.75,
			margin: {top: 180, left: 50},
			tableWidth: 500,
			columnStyles: {
				no: {columnWidth: 50},
				contestant: {columnWidth: 205},
				average: {columnWidth: 125},
				rank: {columnWidth: 130}
			},
			styles: {
				lineColor: [75, 75, 75],
				lineWidth: 0.50,
				cellPadding: 3
			},
			headerStyles: {
				halign: 'center',		
				fillColor: [191, 191, 191],
				textColor: 50,
				fontSize: 10
			},
			bodyStyles: {
				halign: 'center',
				fillColor: [255, 255, 255],
				textColor: 50,
				fontSize: 10
			},
			alternateRowStyles: {
				fillColor: [255, 255, 255]
			}
		});

		var blob = doc.output("blob");
		window.open(URL.createObjectURL(blob));
		
	};

});	